window.onload = () => {
    console.log("http://" + window.location.hostname + ':8888/static/json/data.json');
    loadData();
}

function loadData() {
  console.log("http://" + window.location.hostname + ':8888/static/json/data.json');
	var xhr = new XMLHttpRequest();
  console.log("http://" + window.location.hostname + ':8888/static/json/data.json');
	xhr.open('GET', "http://" + window.location.hostname + ':8888/static/json/data.json?' + new Date().getTime(), true);
	xhr.send();
	xhr.onreadystatechange = function() {
	    if (xhr.readyState != 4) return;
	    if (xhr.status != 200) {
	      	console.log(xhr.status + ': ' + xhr.statusText);
	    } else {
	    	let data = JSON.parse(xhr.responseText)
	    	console.log(data)
	    	if(data.theme == 1) {
		        themeFirst(data);
		    }else if(data.theme == 2) {
		        themeSecond(data);
		    }else if(data.theme == 3) {
		        themeThird(data);
		    }
	    }
	}
}

function themeFirst(data) {

	let themeContent = document.getElementById('theme-content');

	let themeFirst = document.createElement('div');
	themeFirst.className= 'theme-first';

	let header = document.createElement('header');
	header.className = 'header';

	let div = document.createElement('div');
	div.className = 'head-left-item';
	let img = document.createElement('img');
	img.setAttribute('src', "http://" + window.location.hostname + ':8888/static/image/logo-white.png');
	img.setAttribute('alt', 'logo');

	let div2 = document.createElement('div');
	div2.innerHTML = `<h3>НҰР ОТАН</h3>
	<p>ПАРТИЯСЫ САЙЛАУАЛДЫ<br>БАҒДАРЛАМАСЫ</p>`;

	div.insertBefore(img, div.children[0]);
	div.insertBefore(div2, div.children[1]);

	header.insertBefore(div, header.children[0]);
	let div3 = document.createElement('div');
	div3.className = 'head-right-item';

	let div4 = document.createElement('div');
	div4.className = 'arrows';

	div4.innerHTML = `<img src="` + "http://" + window.location.hostname + `:8888/static/image/theme1-left.png" alt="left-arrow">
	<img id="logo-home" src="` + "http://" + window.location.hostname + `:8888/static/image/home.png" alt="left-arrow">
	<img src="` + "http://" + window.location.hostname + `:8888/static/image/theme1-right.png" alt="left-arrow">`;

	div3.insertBefore(div4, div3.children[0]);
	header.insertBefore(div3, header.children[1]);

	let div5 = document.createElement('div');
	div5.className = 'menu-buttons';
	for(let i = 0; i < data.roditeli.length; i++) {
		let span = document.createElement('span');
		span.innerHTML = data.roditeli[i].title;
		div5.insertBefore(span, div5.children[i]);
		if(i == (data.roditeli.length -1)) span.className='active1';
	}

	div3.insertBefore(div5, div3.children[1]);
	themeFirst.insertBefore(header, themeFirst.children[0]);

	if(data.type == 2){
		buttonSlide(themeFirst);
	}else if(data.type == 1){
		map(themeFirst)
	}else {
		let container = document.createElement('div');
		container.className = 'container';

		let wrapper = document.createElement('div');
		wrapper.className = 'wrapper';
		themeFirst.insertBefore(wrapper, themeFirst.children[1]);
		wrapper.insertBefore(container, wrapper.children[0]);
		themeFirst.insertBefore(wrapper, themeFirst.children[1]);

		let ul = document.createElement('ul');
		ul.setAttribute( "id", "start-block" );

		for(let i = 0;i < data.dochki.length; i++) {
			let li = document.createElement('li');
			li.innerHTML += `<img src="`+ data.dochki[i].img + `" alt='image'>
			<div class='info'><h2>`+ data.dochki[i].title +`</h2>
			<p>`+ data.dochki[i].text.substring(0,40) +`...</p></div>`;
			ul.insertBefore(li, ul.children[i])
		}

	container.appendChild(ul);
	}
	themeContent.appendChild(themeFirst);
	btnClick(data);
	mapClick();
}

// Theme1 button click

function btnClick (data) {
	let li = document.querySelectorAll('.container ul li');
	let span = document.querySelectorAll('.menu-buttons span');
	let home = document.getElementById('logo-home');
	console.log(data)
	home.onclick = () => {
		ajaxClickButton(data.roditeli[0].ID);
	}

	for(let i=0; i<span.length;i++) {
		span[i].onclick = () => {
			// console.log(i);
			let hrf = data.ID;
			// hrf.slice(-(2*i);
			ajaxClickButton(hrf);
		}
	}

	for(let i=0;i<li.length;i++) {
		li[i].onclick = () => {
			console.log(data.dochki[i].ID)
			blockClickAjax(data.dochki[i].ID);
			for(let j = 0; j < li.length; j++) {
				li[j].classList.remove('active-block');
			}
			li[i].classList.add('active-block');
			setTimeout(function() {
				li[i].classList.remove('active-block');
			},5000)
		}
	}
}

// Theme1 click Block

function blockClickAjax(hrf) {
	console.log(hrf);
	let xhr = new XMLHttpRequest();
      	xhr.open('GET',  "http://" + window.location.hostname +':8888/click/1/ru/'+hrf, true);
      	console.log(window.location.hostname);
      	xhr.send();
      	xhr.onreadystatechange = function() {
	        if (xhr.readyState != 4) return;
	        if (xhr.status != 200) {
	          	alert(xhr.status + ': ' + xhr.statusText);
	        } else {
	          	let theme = document.querySelector('#theme-content');

				theme.removeChild(theme.firstChild);
				let data = JSON.parse(xhr.responseText);
				console.log(data);
	          	console.log("+");
	          	themeFirst(data);
	        }
		}
}

// Theme 1 Slide Button

function buttonSlide( themeFirst) {

	let wrapperButton = document.createElement('div');
	wrapperButton.className = 'wrapper-button';

	let  wrapperCenter = document.createElement('div');
	wrapperCenter.className = 'wrapper-center';


	let buttonLeft = document.createElement('div');
	buttonLeft.className = 'button';
	buttonLeft.innerHTML = '<img src="' + "http://" + window.location.hostname +':8888/static/image/theme1-left2.png" alt=""><span>НАЗАД</span>';

	let buttonCenter = document.createElement('div');
	buttonCenter.className = 'button button-active';
	buttonCenter.innerHTML = '<img src="' + "http://" + window.location.hostname +':8888/static/image/theme1-return.png" alt=""><span>НА ГЛАВНУЮ</span>';

	let buttonRigth = document.createElement('div');
	buttonRigth.className = 'button';
	buttonRigth.innerHTML = '<img src="' + "http://" + window.location.hostname +':8888/static/image/theme1-right2.png" alt=""><span>ВПЕРЕД</span>';

	wrapperCenter.insertBefore(buttonLeft, wrapperCenter.children[0]);
	wrapperCenter.insertBefore(buttonCenter, wrapperCenter.children[1]);
	wrapperCenter.insertBefore(buttonRigth, wrapperCenter.children[2]);

	wrapperButton.appendChild(wrapperCenter);
	themeFirst.insertBefore(wrapperButton, themeFirst.children[1]);
}

